const mongoose=require("mongoose");

const Eschema=new mongoose.Schema({
    title:{
        type:String,
        required:true,
    },
    description:String,
    image:{
        type:String,
        default:"data:image/jpeg;base64,",
        set:(v)=>v===""?"data:image/jpeg;base64,":v
        },
    price:Number,

});


//create model
const EListing=mongoose.model("EListing",Eschema);
module.exports=EListing;